import React, { useState } from "react";
import Swal from "sweetalert2";

const Register = () => {
    const [formData, setFormData] = useState({
        primerNombre: "",
        segundoNombre: "",
        primerApellido: "",
        segundoApellido: "",
        identificacion: "",
        email: "",
        fechaNacimiento: "",
        ubicacion: {
            lugar: "",
            ciudad: "",
            departamento: "",
        },
        usuario: {
            login: "",
            password: "",
        },
    });

    const [showModal, setShowModal] = useState(false);
    const [modalMessage, setModalMessage] = useState("");
    const [modalType, setModalType] = useState("");

    const handleInputChange = (e) => {
        const { name, value } = e.target;
        setFormData((prevData) => ({
            ...prevData,
            [name]: value,
        }));
    };

    const handleUbicacionChange = (e) => {
        const { name, value } = e.target;
        setFormData((prevData) => ({
            ...prevData,
            ubicacion: {
                ...prevData.ubicacion,
                [name]: value,
            },
        }));
    };

    const handleSubmit = async (e) => {
        e.preventDefault();

        // Validaciones de fecha
        const currentDate = new Date();
        const selectedDate = new Date(formData.fechaNacimiento);
        const year = selectedDate.getFullYear();

        if (selectedDate > currentDate) {
            setModalMessage("La fecha de nacimiento no puede ser futura.");
            setModalType("error");
            setShowModal(true);
            return;
        }

        if (year < 1900 || year > 2100) {
            setModalMessage("El año de nacimiento debe estar entre 1900 y 2100.");
            setModalType("error");
            setShowModal(true);
            return;
        }

        const dataToSend = {
            ...formData,
            identificacion: parseInt(formData.identificacion),
            usuario: {
                ...formData.usuario,
                id: {
                    login: formData.usuario.login,
                    persona: null, // Este se establecerá en el backend
                },
            },
        };

        try {
            const response = await fetch("http://localhost:9001/Laboratorio1/persona", {
                method: "POST",
                headers: {
                    "Content-Type": "application/json",
                },
                body: JSON.stringify(dataToSend),
            });

            let responseData;
            const contentType = response.headers.get("content-type");
            if (contentType && contentType.includes("application/json")) {
                responseData = await response.json();
            } else {
                responseData = await response.text();
            }

            if (response.ok) {
                setModalMessage(typeof responseData === 'object' ? responseData.message : responseData);
                setModalType("success");
                setShowModal(true);
                // Limpiar el formulario después de guardar
                setFormData({
                    primerNombre: "",
                    segundoNombre: "",
                    primerApellido: "",
                    segundoApellido: "",
                    identificacion: "",
                    email: "",
                    fechaNacimiento: "",
                    ubicacion: {
                        lugar: "",
                        ciudad: "",
                        departamento: "",
                    },
                    usuario: {
                        login: "",
                        password: "",
                    },
                });
            } else {
                // Manejo de errores
                setModalMessage(typeof responseData === 'object' ? responseData.message : responseData);
                setModalType("error");
                setShowModal(true);
            }
        } catch (error) {
            console.error("Error:", error);
            setModalMessage("Error en la solicitud.");
            setModalType("error");
            setShowModal(true);
        }
    };

    return (
        <div className="container">
            <h2>Registro de Usuario</h2>
            <form onSubmit={handleSubmit}>
                <div className="form-group">
                    <label htmlFor="primerNombre">Primer Nombre:</label>
                    <input
                        type="text"
                        className="form-control"
                        id="primerNombre"
                        name="primerNombre"
                        value={formData.primerNombre}
                        onChange={handleInputChange}
                    />
                </div>
                <div className="form-group">
                    <label htmlFor="segundoNombre">Segundo Nombre:</label>
                    <input
                        type="text"
                        className="form-control"
                        id="segundoNombre"
                        name="segundoNombre"
                        value={formData.segundoNombre}
                        onChange={handleInputChange}
                    />
                </div>
                <div className="form-group">
                    <label htmlFor="primerApellido">Primer Apellido:</label>
                    <input
                        type="text"
                        className="form-control"
                        id="primerApellido"
                        name="primerApellido"
                        value={formData.primerApellido}
                        onChange={handleInputChange}
                    />
                </div>
                <div className="form-group">
                    <label htmlFor="segundoApellido">Segundo Apellido:</label>
                    <input
                        type="text"
                        className="form-control"
                        id="segundoApellido"
                        name="segundoApellido"
                        value={formData.segundoApellido}
                        onChange={handleInputChange}
                    />
                </div>
                <div className="form-group">
                    <label htmlFor="identificacion">Identificación:</label>
                    <input
                        type="number"
                        className="form-control"
                        id="identificacion"
                        name="identificacion"
                        value={formData.identificacion}
                        onChange={handleInputChange}
                    />
                </div>
                <div className="form-group">
                    <label htmlFor="email">Email:</label>
                    <input
                        type="email"
                        className="form-control"
                        id="email"
                        name="email"
                        value={formData.email}
                        onChange={handleInputChange}
                    />
                </div>
                <div className="form-group">
                    <label htmlFor="fechaNacimiento">Fecha de Nacimiento:</label>
                    <input
                        type="date"
                        className="form-control"
                        id="fechaNacimiento"
                        name="fechaNacimiento"
                        value={formData.fechaNacimiento}
                        onChange={handleInputChange}
                    />
                </div>
                <h4>Ubicación</h4>
                <div className="form-group">
                    <label htmlFor="lugar">Lugar:</label>
                    <input
                        type="text"
                        className="form-control"
                        id="lugar"
                        name="lugar"
                        value={formData.ubicacion.lugar}
                        onChange={handleUbicacionChange}
                    />
                </div>
                <div className="form-group">
                    <label htmlFor="ciudad">Ciudad:</label>
                    <input
                        type="text"
                        className="form-control"
                        id="ciudad"
                        name="ciudad"
                        value={formData.ubicacion.ciudad}
                        onChange={handleUbicacionChange}
                    />
                </div>
                <div className="form-group">
                    <label htmlFor="departamento">Departamento:</label>
                    <input
                        type="text"
                        className="form-control"
                        id="departamento"
                        name="departamento"
                        value={formData.ubicacion.departamento}
                        onChange={handleUbicacionChange}
                    />
                </div>
                <h4>Usuario</h4>
                <div className="form-group">
                    <label htmlFor="usuario.login">Nombre de Usuario:</label>
                    <input
                        type="text"
                        className="form-control"
                        id="usuario.login"
                        name="usuario.login"
                        value={formData.usuario.login}
                        onChange={handleInputChange}
                    />
                </div>
                <div className="form-group">
                    <label htmlFor="usuario.password">Contraseña:</label>
                    <input
                        type="password"
                        className="form-control"
                        id="usuario.password"
                        name="usuario.password"
                        value={formData.usuario.password}
                        onChange={handleInputChange}
                    />
                </div>
                <button type="submit" className="btn btn-primary">Registrar</button>
            </form>

            {showModal && (
                <Swal
                    title={modalType === "error" ? "Error" : "Éxito"}
                    text={modalMessage}
                    icon={modalType === "error" ? "error" : "success"}
                    onClose={() => setShowModal(false)}
                />
            )}
        </div>
    );
};

export default Register;
